,ERR_CAMPAIGN_ANALYTICS:"Error getting campaign analytics: ${0}",PRIVILEGES_LEVEL_WARNING_MSG:'You have "${0}" level privileges. Some functionalities may not be available.',ADEX_ACCOUNT:"AdEx account",ERR_INSUFFICIENT_BALANCE_WITHDRAW:"Insufficient account balance: Balance: ${0}, Fees: ${1}, Withdraw amount: ${2}",ERR_ZERO_WITHDRAW_AMOUNT:"Withdraw amount can not be 0",TUTORIAL_CREATE_AD_UNIT_TITLE:"How to create an ad unit",TUTORIAL_CREATE_AD_UNIT_STEP_1:"Go to your Advertiser dashboard > Ad Units and click the <strong>\u201cNew Ad unit\u201d</strong> button.",TUTORIAL_CREATE_AD_UNIT_STEP_2:"Enter a name for your ad unit, add a description (optional).",TUTORIAL_CREATE_AD_UNIT_STEP_3:"Next, point a <strong>URL</strong> where users will land after clicking on your ad.",TUTORIAL_CREATE_AD_UNIT_STEP_4:"Choose the size of the creative you\u2019ll upload. You can add your own UTM tracking or select to add Google UTM tracking.",TUTORIAL_CREATE_AD_UNIT_STEP_5:"Add your ad creative. Keep in mind that it must be the same size as the ad unit for our system to accept it. Press <strong>\u201cContinue\u201d</strong>.",TUTORIAL_CREATE_AD_UNIT_STEP_6:"On the next step, define the targeting for your ad. Filling in these fields is optional, however the more targeting settings you specify, the higher the expected success rate of your ad. ",TUTORIAL_CREATE_AD_UNIT_STEP_7:"Set a weight score for each target using the handy slider. This score indicates how important that particular targeting criteria is for your campaign, and helps you achieve a more precise targeting.",TUTORIAL_CREATE_AD_UNIT_STEP_8:"Review if everything looks good, then hit <strong>\u201cSave\u201d</strong>.",TUTORIAL_CREATE_AD_UNIT_END:"The created ad unit will then appear in the <strong>\u201cAd Units\u201d</strong> section of your Advertiser account.",TUTORIAL_FUND_ACC_TITLE:"How to fund your account",TUTORIAL_FUND_ACC_START:"Follow these steps to fund your account:",TUTORIAL_FUND_ACC_STEP_1:"Click on <strong>Account</strong> in the lower left corner of the screen.",TUTORIAL_FUND_ACC_STEP_2:"On your Account screen you will see your <strong>AdEx account and your available balance.</strong>",TUTORIAL_FUND_ACC_STEP_3:"Next to the address you\u2019ll see the <strong>Copy icon</strong>. Just click it and you\u2019ll copy the address.",TUTORIAL_FUND_ACC_STEP_4:"Now that you have it, just send DAI to it using your preferred wallet. Please note that you can only send DAI to your AdEx account.",TUTORIAL_FUND_ACC_MORE_INFO:"Alternatively you can top up your account with GBP. More information can be found ${0}",TUTORIAL_FUND_ACC_END:"When you have enough funds in your Identity address, you can start running campaigns on AdEx Network.",TUTORIAL_LAUNCH_CAMPAIGN_TITLE:"How to launch your first campaign",TUTORIAL_LAUNCH_CAMPAIGN_START:"Follow these steps to launch your first advertising campaign on AdEx.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_1:"On the sidebar menu, click on the <strong>\u201cCampaigns\u201d</strong> and then the <strong>\u201cNew Campaign\u201d</strong> button on the right.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_2:"On the next screen, choose which existing ad units to assign to your campaign. ",TUTORIAL_LAUNCH_CAMPAIGN_STEP_3:"Set the validators, the campaign total budget, your CPM price and start and end dates of your campaign. When you click on the dates slots, a small calendar will open for you to select dates, then hit <strong>\u201cContinue\u201d</strong>.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_4:"When creating a campaign you have the option to select to only show the ad if targeting matches. If you tick this box, then your ad will appear only on such websites which correspond to the targeting criteria specified by you. This may mean your ad may not show if there are no relevant publishers at the moment. But this way you ensure that you won't spend your advertising budget by showing an ad people are not currently interested in.",TUTORIAL_LAUNCH_CAMPAIGN_STEP_5:"Preview your campaign and check if everything looks good. If you need to make any edits, use the <strong>\u201cBack\u201d</strong> button. If things look fine, just save it.",TUTORIAL_LAUNCH_CAMPAIGN_END:"Your campaign is now created and it will start running on the <strong>\u201cStart date\u201d</strong> you have set.",TUTORIAL_CREATE_AD_SLOT_TTILE:"How to create an ad slot",TUTORIAL_CREATE_AD_SLOT_STEP_1:"In the dashboard, click on <strong>\u201cAd Slots\u201d</strong> on the left sidebar menu.",TUTORIAL_CREATE_AD_SLOT_STEP_2:"Click on the <strong>\u201cNew Ad Slot\u201d</strong> button in the upper right corner.",TUTORIAL_CREATE_AD_SLOT_STEP_3:"Fill in the <strong>name of your ad slot</strong> (mandatory) and its description (optional).",TUTORIAL_CREATE_AD_SLOT_STEP_4:"From the bottom dropdown menu choose the size of your ad slot. Be sure to match the size of your inventory, otherwise the ads won\u2019t display properly.",TUTORIAL_CREATE_AD_SLOT_STEP_5:"Set your fallback image preferences. If you select a fallback image and URL, they will be displayed when no matching ads are available for this slot. Otherwise the ad slot will be hidden automatically. If you choose to use a fallback image, make sure that the image you upload matches your ad slot size.",TUTORIAL_CREATE_AD_SLOT_STEP_6:"Time to adjust <strong>targeting options</strong> for your ad slot. You can add both predefined affinity categories and/or create and add custom targeting categories. For each targeting category you can add weight from 0 to 100\u200a\u2014\u200adefining how strong is this targeting.",TUTORIAL_CREATE_AD_SLOT_STEP_7:"Preview your ad slot settings. Looking good? Hit <strong>\u201cSave\u201d</strong>. Forgot to add something? Click on <strong>\u201cBack\u201d</strong>.",TUTORIAL_CREATE_AD_SLOT_END:"Your new ad property item will now appear in the <strong>\u201cAd Slots\u201d</strong> section of your account.",TUTORIAL_PLACE_AD_SLOT_TITLE:"How to place an ad slot on your site",TUTORIAL_PLACE_AD_SLOT_STEP_1:"On the Publisher Dashboard, click on <strong>Ad Slots</strong>. Click on the <strong>\u201cView\u201d</strong> button for the ad slot you want to implement on your website and scroll down to <strong>\u201cIntegration\u201d</strong>.",TUTORIAL_PLACE_AD_SLOT_STEP_2:"Copy the integration code, then paste it on your website.",TUTORIAL_PLACE_AD_SLOT_MORE_INFO:"Take a look at those tutorials just in case:",TUTORIAL_PLACE_AD_SLOT_INFO_LINK_1:"How to integrate 'iframe' in HTML",TUTORIAL_PLACE_AD_SLOT_INFO_LINK_2:"How to integrate 'iframe' in WordPress",TUTORIAL_CONFIRM_EMAIL_LABEL:"Confirm your email address",TUTORIAL_CONFIRM_EMAIL_CONTENT:"Welcome to the platform. Let's first confirm your email! <strong>Check your inbox for the confirmation link.</strong>",TUTORIAL_ADD_UNIT_LABEL:"Create an ad unit",TUTORIAL_ADD_UNIT_CONTENT:"Your account is ready. Let's create your first ad!",TUTORIAL_FUND_ACCOUNT_LABEL:"Fund your account",TUTORIAL_FUND_ACCOUNT_CONTENT:"Now that you have your first ad unit, let's fund your account!",TUTORIAL_FIRST_CAMPAIGN_LABEL:"Launch your first campaign",TUTORIAL_FIRST_CAMPAIGN_CONTENT:"Now that you have money in your account, let's launch your first campaign!",TUTORIAL_ADD_SLOT_LABEL:"Create an ad slot",TUTORIAL_ADD_SLOT_CONTENT:"Your account is ready. Let's create your first ad slot!",TUTORIAL_PLACE_SLOT_LABEL:"Place an ad slot on your site",TUTORIAL_REACH_5000_LABEL:"Reach 5,000 impressions for your ad slot(s)",TUTORIAL_REACH_5000_CONTENT:"Now that you have your ad slot added, let's reach your first 5,000 impressions!",GETTING_STARTED_HEADING:"Getting Started",NEXT:"NEXT",BACK:"BACK",GETTING_STARTED_FINISHED:"You have completed all steps",DISMISS:"Dismiss",GETTING_STARTED_STEPS:"STEP ${0}: ${1}",GETTING_STARTED_NOT_SURE_SEE_TUTORIAL:"Not sure how? See ${0}",OUR_TUTORIAL:"Our tutorial",TUTORIAL_CONFIRM_EMAIL_COMPLETE:"You have confirmed your email successfully!",TUTORIAL_CREATE_UNIT_COMPLETE:"You have created an ad unit successfully!",TUTORIAL_FUND_ACC_COMPLET